const Navbar = () => {

    return (
        <div className="navbar-main">
            <nav>
                <ul>
                    <li><Link to="/">Home</Link></li>
                    <li><Link to="/movies">Movies</Link></li>
                </ul>
            </nav>
        </div>
    );
}

export default Navbar;
